import 'ag-grid-community/dist/styles/ag-theme-alpine.css';
import Card from './Card';
import 'tachyons';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      columnDefs:[
      // {headerName: 'Make', field:'make',sortable: true, filter:true},
